#include <algorithm>
#include <chrono>
#include <iostream>
#include <vector>
#include <map>

using namespace std;
using namespace std::chrono;


class Solution {
public:
    bool isIsomorphic(string s, string t) 
    {
        map<char, char> map;

        int i = 0;
        while (i < s.size())
        {
            if (map.find(s[i]) != map.end())
            {
                if (map[s[i]] != t[i])
                {
                    return 0;
                }
            }
            else
            {
                for (std::map<char, char>::iterator itr = map.begin(); itr != map.end(); itr++)
                {
                    if (itr->second == t[i])
                    {
                        return 0;
                    }
                }
                map[s[i]] = t[i];
            }
            i++;
        }

        return 1;
    }
};


